import React, { Component } from 'react'
import {storeProducts} from "./data"

export default class Table extends Component {
    constructor(props){
        super(props)
        this.state = {
            store:storeProducts.data
        }
    }

    render() {
        let tableRow = this.state.store.map((item, index)=>{
            return (
                <tr key={index}>
                    {item.month}
                </tr>
            )
        })
        return (
            <table>
                <tr>
                    <th>
                        month
                    </th>
                </tr>
                <tr>
                    <td>
                        {tableRow}
                    </td>
                </tr>
            </table>
        )
    }
}
